package enigma

import com.aurelioklv.enigma.component.ReflectorType
import com.aurelioklv.enigma.component.RotorType
import com.aurelioklv.enigma.util.Factory
import org.junit.jupiter.api.Test
import kotlin.test.assertEquals
import kotlin.test.assertNotEquals

class EnigmaTest {

    private val LONG_MESSAGE =
        ""

    private val SHORT_MESSAGE_1 = "LoReM IpsUM DoLoR sIt AmET CoNSeCTeTuR adIpISCInG elIT"
    private val SHORT_MESSAGE_2 = "seD dO EiUSmoD tEmPor IncIdiDuNT uT LabOre eT dolOrE maGnA aLiqUa"

    @Test
    fun simpleEncryption() {
        val enigmaI = Factory.createEnigma(
            Factory.createPlugboard(wiringString = "vbnmhjklasdfqwertyui"),
            rotorTypes = listOf(RotorType.ROTOR_V, RotorType.ROTOR_I, RotorType.ROTOR_V),
            reflectorType = ReflectorType.REFLECTOR_UKW_B_ENIGMA_I
        )
        enigmaI.config(rotorInitialLetter = listOf('R', 'C', 'Q'))

        val chipertext = enigmaI.process(LONG_MESSAGE, preserveCase = true)

        with(enigmaI) {
            config(rotorInitialLetter = listOf('r', 'C', 'q'))
            val plaintext = process(chipertext, preserveCase = true)
            assertEquals(LONG_MESSAGE, plaintext)
        }

    }

    @Test
    fun repeatedEncryption() {
        val enigmaM4 = Factory.createEnigma(
            Factory.createPlugboard(wiringString = "KRYPTOSX"),
            rotorTypes = listOf(RotorType.ROTOR_GAMMA, RotorType.ROTOR_VI, RotorType.ROTOR_II, RotorType.ROTOR_III),
            reflectorType = ReflectorType.REFLECTOR_UKW_C_THIN
        )
        enigmaM4.config(rotorInitialLetter = listOf('J', 'B', 'R', 'N'))

        val chipertext1 = enigmaM4.process(SHORT_MESSAGE_1, preserveCase = true)
        val chipertext2 = enigmaM4.process(SHORT_MESSAGE_2, preserveCase = true)

        with(enigmaM4) {
            config(rotorInitialLetter = listOf('J', 'B', 'R', 'N'))
            val plaintext1 = process(chipertext1, preserveCase = true)
            val plaintext2 = process(chipertext2, preserveCase = true)

            assertEquals(plaintext1, SHORT_MESSAGE_1)
            assertEquals(plaintext2, SHORT_MESSAGE_2)
        }
    }

    @Test
    fun wrongRotorConfig_incorrectEncryption() {
        val enigmaM3 = Factory.createEnigma(
            Factory.createPlugboard(wiringString = "qawsedrftgyhujikolpz"),
            rotorTypes = listOf(RotorType.ROTOR_VIII, RotorType.ROTOR_VII, RotorType.ROTOR_IV),
            reflectorType = ReflectorType.REFLECTOR_UKW_C_ENIGMA_M3
        )
        enigmaM3.config(rotorInitialLetter = listOf('K', 'T', 'x'))

        val chipertext = enigmaM3.process(LONG_MESSAGE)

        with(enigmaM3) {
            config(rotorInitialLetter = listOf('J', 'S', 'x'))
            val plaintext = process(chipertext)

            assertNotEquals(LONG_MESSAGE, plaintext)
        }
    }
}